            flexDirection: "column",
            padding: "0 100px",
          }}
        >
          <div className="cerinta">Afla linkul pentru urmatorul nivel!</div>
          <div className="re">
            <h3>Name</h3>
            <div className="filters">
              <select>
                {Data.map((e) => {
                  return <option value={e.name}>{e.name}</option>;
                })}
              </select>
            </div>
