              {data.map((d) => {
                return (
                  <>
                    <div key={d.id} style={{ margin: "10px" }} className="nu">
                      <h5>{d.name}</h5>
                    </div>
                  </>
                );
              })}
            </div>
          </div>
        </div>
      )}
    </>
  );
}

export default Sort;
